PLAYER: .word   0x000000, 0x000000, 0xe5aa7a , 0x000000, 0x000000, 0xe5aa7a, 0x990030,  0x990030, 0x990030, 0xe5aa7a, 0x000000, 0x000000, 0xffffff, 0x000000, 0x000000
0x000000, 0xe5aa7a, 0x000000, 0xe5aa7a, 0x000000

FIRE:	.word 0x000000, 0x000000, 0xff7700, 0x000000, 0x000000,
          0x000000, 0xff7700, 0xffc496, 0xff7700, 0x000000,
          0xff7700, 0xffc496, 0xeb5a1d, 0xa94a01, 0xff7700,
          0xff7700, 0xa94a01, 0xffc496, 0xff7700, 0xa94a01

ACID:	.word 0x947f71, 0x000000, 0xed1c23, 0x000000, 0xed1c23, 0x00000000, 0x947f71,
          0x947f71, 0x00000000, 0x000000, 0xed1c23, 0x00000000, 0x00000000, 0x947f71,
          0x947f71, 0x00000000, 0xed1c23, 0x00000000, 0xed1c23, 0x00000000, 0x947f71,
          0x947f71, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x00000000, 0x947f71,
          0x00000000, 0x947f71, 0x947f71, 0x947f71, 0x947f71, 0x947f71, 0x00000000

WAIT_TIME:	.word 	400	
girl:		.word	0	# stores the girl's position
player_state:	.word	0	# stores the state of girl 0 - stationary 1 - left walking 2 - right walking 3 - jump / air 4 - falling 
game_state:	.word	0	# stores state of game 0 - start_screen, 1 - level, 2 - win, 3 - lose, 4 - end
fire1:		.word	0	# position of fire 1
fire2:		.word	0	# position of fire 2 
acid: 		.word 	0 	# position of deadly acid
collision:	.word	1	# boolean 0 - not on platform 1 - player on platform

.text 

.globl main
main:	
	jal 	clear_screen
	sw	$zero, game_state		# game_state = zero
	jal	start_screen
	la 	$t0, 0xffff0000  		# check if a key_press happened
	lw 	$t1, 0($t0) 
	beq 	$t1, 1, key_press_start
	jal 	sleep
	j	main
	
key_press_start:
	lw 	$t0, 4($t0) 
	beq	$t0, 0x77, start		# w to start
	beq 	$t0, 0x73, exit			# s to exit
	
start:
	addi	$t0, $zero, 14848		# declear start pos of girl
	sw	$t0, girl
	addi	$t0, $zero, 11372		# declear start pos of fire 
	sw 	$t0, fire1
	addi	$t0, $zero, 3940		# declear start pos of fire2 
	sw 	$t0, fire2
	addi	$t0, $zero, 14652		# declear start pos of acid
	sw 	$t0, acid
	j	main_loop
	
exit:	
	jal	clear_screen
	li	$v0, 10
	syscall

main_loop:
	la	$s0, BASE_ADDRESS
	jal 	clear_screen
	jal 	background
	
	lw	$s2, fire1			# fire 1 start postion
	jal 	fire
	
	lw	$s3, fire2			# fire 2 start postion
	jal 	fire_2
	
	lw	$s4, acid			# acid start postion
	jal 	draw_acid
	
	lw	$s1, girl			# player start position in s1
	add	$s5, $zero, $zero
	jal 	check_collision			# 1 if collision with platform, 0 if no collision 
	bne	$s5, 1, end_check
	jal 	player
	j 	cont
end_check:
	add 	$s1, $s1, 256
	sw	$s1, girl
	jal 	player
	
cont:
	la 	$t0, 0xffff0000  		# check if a key_press happened
	lw 	$t1, 0($t0)
	beq	$t1, 1, key_press		
	jal	sleep
	#j 	exit
	j 	main_loop

################# handle key presses ######################
key_press:
	lw 	$t0, 4($t0)
	beq 	$t0, 0x61, a_pressed
	beq 	$t0, 0x64, d_pressed
	beq 	$t0, 0x77, w_pressed
	beq	$t0, 0x70, p_pressed
	j	no_key

a_pressed:
	lw	$s1, girl			# player start position in s1
	li	$t0, 256
	div	$s1, $t0
	mfhi	$t0
	beq	$t0, 0, no_key
	addi	$s1, $s1, -8
	sw	$s1, girl
	j	no_key

d_pressed:
	lw	$s1, girl
	addi	$t1, $s1, 5
	li 	$t0, 256
	div	$t1, $t0
	mfhi	$t0
	bgt	$t0, 236, no_key
	addi	$s1, $s1, 8
	sw	$s1, girl
	j 	no_key
		
w_pressed:
	lw	$s1, girl
	addi	$s1, $s1, -1024
	sw	$s1, girl
	j 	no_key
	
p_pressed:
	jal clear_screen
	jal exit
	
no_key:
	j main_loop
################# clear screen ############################
clear_screen:
	la	$t0, BASE_ADDRESS
	la	$t1, 0($t0)
	la 	$t2, 16384($t0)
	la 	$t3, 0x000000	# load black
	
clear:	beq	$t1, $t2, end_clr_screen
	sw	$t3, 0($t1)
	addi	$t1, $t1, 4
	j	clear

end_clr_screen:
	jr 	$ra
	
################# load start screen #######################	
start_screen:
      li 	$t0, BASE_ADDRESS
      la 	$t1, START_SCREEN
      li 	$t2, 0
starting_loop: 
      beq 	$t2, 6000, end_start_loop
      lw 	$t3, 0($t1)
      beq 	$t3, 0X00000000, update_start_l 	# only draw non-black bg
      sw 	$t3, 0($t0) 
update_start_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	starting_loop
end_start_loop:     
      jr 	$ra

sleep:
      li 	$v0, 32    
      lw	$s7, WAIT_TIME  
      add 	$a0, $zero, $s7
      syscall
      jr 	$ra

################## load background #######################
background: 
      li 	$t0, BASE_ADDRESS
      la 	$t1, BACKGROUND
      li 	$t2, 0
      
background_loop: 
      #beq $t2, 6000, end_bg_loop
      beq 	$t2, 6000, end_bg_loop
      lw 	$t3, 0($t1)
      #beq $t3, 0X00000000, update_bg_l
      sw 	$t3, 0($t0) 
      
update_bg_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	background_loop
      
end_bg_loop:      
      jr 	$ra

#################### player ###############################
player:
	lw	$t0, girl
	add	$t0, $s1, $zero
	la 	$t1, PLAYER
	#lw 	$t0, PLAYER_POS
	addi	$t0, $t0, BASE_ADDRESS
	li 	$t2, 0
	
start_outer:
	beq 	$t2, 4, end_outer
	li 	$t3, 0
	
start_inner: 
	beq 	$t3, 5, update_inner
	lw 	$t4, 0($t1)
	sw 	$t4, 0($t0)
	addi 	$t1, $t1, 4
	addi 	$t0, $t0, 4
	addi 	$t3, $t3, 1
	j 	start_inner

update_inner:
	sub 	$t0, $t0, 20
	addi 	$t0, $t0, 256
	addi 	$t2, $t2, 1
	j 	start_outer

end_outer:
	jr $ra

##############################################

#################### fire ###############################
fire:
	lw	$t0, fire1
	add	$t0, $s2, $zero
	la 	$t1, FIRE
	addi	$t0, $t0, BASE_ADDRESS
	li 	$t2, 0
	
start_outer_fire:
	beq 	$t2, 4, end_outer_fire
	li 	$t3, 0
	
start_inner_fire: 
	beq 	$t3, 5, update_inner_fire
	lw 	$t4, 0($t1)
	sw 	$t4, 0($t0)
	addi 	$t1, $t1, 4
	addi 	$t0, $t0, 4
	addi 	$t3, $t3, 1
	j 	start_inner_fire

update_inner_fire:
	sub 	$t0, $t0, 20
	addi 	$t0, $t0, 256
	addi 	$t2, $t2, 1
	j 	start_outer_fire

end_outer_fire:
	jr $ra

##############################################
#################### fire2 ###############################
fire_2:
	lw	$t0, fire2
	add	$t0, $s3, $zero
	la 	$t1, FIRE
	addi	$t0, $t0, BASE_ADDRESS
	li 	$t2, 0
	
start_outer_fire_2:
	beq 	$t2, 4, end_outer_fire_2
	li 	$t3, 0
	
start_inner_fire_2: 
	beq 	$t3, 5, update_inner_fire_2
	lw 	$t4, 0($t1)
	sw 	$t4, 0($t0)
	addi 	$t1, $t1, 4
	addi 	$t0, $t0, 4
	addi 	$t3, $t3, 1
	j 	start_inner_fire_2

update_inner_fire_2:
	sub 	$t0, $t0, 20
	addi 	$t0, $t0, 256
	addi 	$t2, $t2, 1
	j 	start_outer_fire_2

end_outer_fire_2:
	jr $ra

##############################################
#################### acid ###############################
draw_acid:
	lw	$t0, acid
	add	$t0, $s4, $zero
	la 	$t1, ACID
	addi	$t0, $t0, BASE_ADDRESS
	li 	$t2, 0
	
start_outer_acid:
	beq 	$t2, 5, end_outer_acid
	li 	$t3, 0
	
start_inner_acid: 
	beq 	$t3, 7, update_inner_acid
	lw 	$t4, 0($t1)
	sw 	$t4, 0($t0)
	addi 	$t1, $t1, 4
	addi 	$t0, $t0, 4
	addi 	$t3, $t3, 1
	j 	start_inner_acid

update_inner_acid:
	sub 	$t0, $t0, 28
	addi 	$t0, $t0, 256
	addi 	$t2, $t2, 1
	j 	start_outer_acid

end_outer_acid:
	jr $ra

##############################################
############# COLLISIONS ####################
check_collision:
	lw 	$s0, girl			# load in player position
	addi	$t0, $s0, 1024			# get the position exactly under the player 
	add	$t0, $t0, BASE_ADDRESS
	lw	$t0, 0($t0)			# check if this position is equal to white
	beq	$t0, 0xffffff, true_plat	# s5 stores whether ther is collision or not 	
	beq	$t0, 0x474345, win
	beq	$t0, 0xff7700, lose
	j	false
lose:
	jal	draw_lose
	li 	$v0, 32
     	lw	$s7, 10000  
      	add 	$a0, $zero, $s7
      	syscall
	jal	exit
	
win:
	jal	draw_win
	li 	$v0, 32    
     	lw	$s7, 10000  
      	add 	$a0, $zero, $s7
      	syscall
	jal	exit
true_plat:
	addi	$t0, $s0, 1028			# get the position exactly under the player 
	add	$t0, $t0, BASE_ADDRESS
	lw	$t0, 0($t0)
	bne	$t0, 0xffffff, false
	addi	$t0, $s0, 1032			# get the position exactly under the player 
	add	$t0, $t0, BASE_ADDRESS
	lw	$t0, 0($t0)
	bne	$t0, 0xffffff, false
	add 	$s5, $zero, 1
	j 	end_collision
false: 
	add $s5, $zero, $zero
	j end_collision

end_collision:
	jr $ra	

######## draw winner screeen ##############################
draw_win: 
      li 	$t0, BASE_ADDRESS
      la 	$t1, WINNER_SCREEN
      li 	$t2, 0
      
win_loop: 
      beq 	$t2, 16000, end_win_loop
      lw 	$t3, 0($t1)
      sw 	$t3, 0($t0) 
      
update_win_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	win_loop
      
end_win_loop:      
      jr 	$ra

######## draw loser screeen ##############################
draw_lose: 
      li 	$t0, BASE_ADDRESS
      la 	$t1, LOSE_SCREEN
      li 	$t2, 0
      
lose_loop: 
      beq 	$t2, 16000, end_lose_loop
      lw 	$t3, 0($t1)
      sw 	$t3, 0($t0) 
      
update_lose_l:  
      addi 	$t0, $t0, 4
      addi 	$t1, $t1, 4
      addi 	$t2, $t2, 1
      j 	lose_loop
      
end_lose_loop:      
      jr 	$ra
